import React from 'react';
import { Container } from 'react-bootstrap';
import { VerticalTimeline, VerticalTimelineElement } from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';

export const Internship = () => {
    return (
        <section id="Internship">
            <Container>
                <div className='mt-4 d-flex justify-content-center'><h1>EXPERIENCE</h1></div>
                <div className='my-4'>
                    <VerticalTimeline lineColor={"black"}>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="Jan 2024 - March 2024"
                            contentStyle={{ background: ' #a8d8b9', color: '#fff' }}
                            contentArrowStyle={{ borderRight: "7px solid #a8d8b9" }}
                            iconStyle={{ background: " #a8d8b9", color: "#fff" }}
                        //    icon={<WorkIcon />}
                        >
                            <h3 className="vertical-timeline-element-title text-dark">PENETRATION TESTER INTERN</h3>
                            <h4 className="vertical-timeline-element-subtitle text-dark">
                                HackersForYou
                            </h4>
                            <p className='text-white-1000 fs-3'>• Web App Penetration testing <br />
                                • Report creating</p>
                        </VerticalTimelineElement>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="2006 - 2008"
                            contentStyle={{ background: ' #a8d8b9', color: '#fff' }}
                            contentArrowStyle={{ borderRight: "7px solid #a8d8b9" }}
                            iconStyle={{ background: " #a8d8b9", color: "#fff" }}
                        //    icon={<WorkIcon />}
                        >
                            <h3 className="vertical-timeline-element-title text-dark">VULNERABLITY ASSESMENT INTERN</h3>
                            <h4 className="vertical-timeline-element-subtitle text-dark">
                                CyberSapiens United LLP
                            </h4>
                            <p className='text-white-1000 fs-3'>User Experience, Visual Design</p>
                        </VerticalTimelineElement>

                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="2006 - 2008"
                            contentStyle={{ background: ' #a8d8b9', color: '#fff' }}
                            contentArrowStyle={{ borderRight: "7px solid #a8d8b9" }}
                            iconStyle={{ background: " #a8d8b9", color: "#fff" }}
                        //    icon={<WorkIcon />}
                        >
                            <h3 className="vertical-timeline-element-title text-dark">Web Designer</h3>
                            <h4 className="vertical-timeline-element-subtitle text-dark">
                                San Francisco, CA
                            </h4>
                            <p className='text-white-1000 fs-3'>User Experience, Visual Design</p>
                        </VerticalTimelineElement>

                        <VerticalTimelineElement
                            iconStyle={{ background: "#a8d8b9", color: "#fff" }}
                        //    icon={<StarIcon />}
                        />
                    </VerticalTimeline>
                </div>
            </Container>
        </section>
    );
}
